import Link from 'next/link'

export default function Btn({ primary, children, className, onClick, link }) {
  return (
    <>
      <Link href={link}>
        <a>
          <button
            className={`.btn ${primary && '.primary ' && className || className}`}
            onClick={onClick}
          >
            {children}
          </button>
        </a>
      </Link>
    </>
  )
}
